import React from 'react';

class Cruises extends React.Component{
    render(){
        return(
            <div>
             <input list="fr"/>
             <datalist id="fr">
                <option>one</option>
             </datalist>

             <input list="browsers"/>
                <datalist id="browsers">
                    <option value="Internet Explorer"/>
                    <option value="Firefox"/>
                    <option value="Chrome"/>
                    <option value="Opera"/>
                    <option value="Safari"/>
                </datalist>
            </div>

        );
    }
}

export default Cruises;
